import React, {memo} from 'react';
import styled from 'styled-components';
import Header from '../../components/Header';
import Footer from '../../components/Footer';

const IndexContainer = styled.div``;

const index = memo(() => {
    return (
        <IndexContainer>
            <Header />
            <Footer />
        </IndexContainer>
    );
});

export default index;
